    <h2 {...{
      "id": "background"
    }}>{`Background`}</h2>
    <h3 {...{
      "id": "what-is-docker"
    }}>{`What is Docker?`}</h3>
    <p><a parentName="p" {...{
        "href": "https://www.docker.com/"
      }}>{`Docker`}</a>{` is an open platform for developing, shipping, and running
applications and services. Docker enables you to separate your services from your infrastructure so you can ship quickly. With Docker, you can manage your infrastructure in the same ways you manage your services. By taking advantage of Docker’s methodologies for shipping, testing, and deploying code quickly, you can significantly reduce the delay between writing code and running it in production.`}</p>
    <h3 {...{
      "id": "what-is-gcp-cloud-storage-gcs"
    }}>{`What is GCP Cloud Storage (GCS)?`}</h3>
    <p><a parentName="p" {...{
        "href": "https://cloud.google.com/storage"
      }}>{`Google Cloud Storage`}</a>{` is a RESTful online file storage web service for storing and accessing data on Google Cloud Platform infrastructure. The service combines the performance and scalability of Google's cloud with advanced security and sharing capabilities. This makes it a prime candidate for log data.`}</p>
    <h2 {...{
      "id": "strategy"
    }}>{`Strategy`}</h2>
    <h3 {...{
      "id": "how-this-guide-works"
    }}>{`How This Guide Works`}</h3>
    <p>{`We'll be using `}<a parentName="p" {...{
        "href": "https://vector.dev"
      }}>{`Vector`}</a>{` to accomplish this task. Vector
is a `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/stargazers"
      }}>{`popular`}</a>{` `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector"
      }}>{`open-source`}</a>{` utility for
building observability pipelines. It's written in `}<a parentName="p" {...{
        "href": "https://www.rust-lang.org/"
      }}>{`Rust`}</a>{`, making it
lightweight, `}<a parentName="p" {...{
        "href": "https://vector.dev/#performance"
      }}>{`ultra-fast`}</a>{` and highly reliable. And
we'll be deploying Vector as a
`}<a parentName="p" {...{
        "href": "/docs/setup/deployment/strategies/#daemon"
      }}>{`daemon`}</a>{`.`}</p>
    <p>{`The `}<a parentName="p" {...{
        "href": "/docs/setup/deployment/strategies/#daemon"
      }}>{`daemon deployment strategy`}</a>{` is designed for data
collection on a single host. Vector runs in the background, in its own process,
collecting `}<em parentName="p">{`all`}</em>{` data for that host.
For this guide, Vector will collect data from
Docker via Vector's
`}<a parentName="p" {...{
        "href": "/docs/reference/sources/docker/"
      }}><inlineCode parentName="a">{`docker`}</inlineCode></a>{`.
The following diagram demonstrates how it works.`}</p>
